import { makeStyles } from "@material-ui/core"
export const fileUploadStyle = makeStyles(({
    upload:{
        height: "167px",
        display: "flex",
        cursor: "pointer",
        margin: "30px 0",
        alignItems: "center",
        justifyContent: "center",
        flexDirection: "column",
        borderRadius: "5px",
        border: "2px dashed #6990F2",
    },
    uploadfiles:{
        borderRadius: "5px",
        border: "2px solid #6990F2",
    }
}))
